/* 
import ExternalLink from "../../assets/images/project-external.png";
import GithubRepo from "../../assets/images/project-source.png";
import { ProjectsData } from "../../data/ProjectsData";
*/

const Projects = () => {
    return (
      <section className="portfolio-grid">
          <section  className="project">
            <img
              
              className="project-img"
            ></img>
            <section className="project-description">
              <p className="white-text p-tag"> project description </p>
              <section className="project-meta-stack ">
                  <p >stackName</p>
              </section>
              <section className="project-links">
                <a href='www.google.com' target="_blank" rel="noreferrer">
                  <img src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.shutterstock.com%2Fimage-vector%2Fimg-vector-icon-design-on-260nw-2164648583.jpg&tbnid=DngDST6WnDiunM&vet=12ahUKEwi7l5HK_f3-AhUYuZUCHcOLDUsQMygPegUIARCAAg..i&imgrefurl=https%3A%2F%2Fwww.shutterstock.com%2Fes%2Fsearch%2Fimg&docid=K9hrZpNWhzFV2M&w=474&h=280&q=img&ved=2ahUKEwi7l5HK_f3-AhUYuZUCHcOLDUsQMygPegUIARCAAg' alt="External link icon"></img>
                </a>
                <a href='www.google.com' target="_blank" rel="noreferrer">
                  <img src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.shutterstock.com%2Fimage-vector%2Fimg-vector-icon-design-on-260nw-2164648583.jpg&tbnid=DngDST6WnDiunM&vet=12ahUKEwi7l5HK_f3-AhUYuZUCHcOLDUsQMygPegUIARCAAg..i&imgrefurl=https%3A%2F%2Fwww.shutterstock.com%2Fes%2Fsearch%2Fimg&docid=K9hrZpNWhzFV2M&w=474&h=280&q=img&ved=2ahUKEwi7l5HK_f3-AhUYuZUCHcOLDUsQMygPegUIARCAAg' alt="Github icon"></img>
                </a>
              </section>
            </section>
          </section>
      </section>
    );
  };
  
  export default Projects;
